import React from "react"
import Movie from "./movie"
import {useState} from 'react'
import './movielist.css'

const MovieList=(props)=>{
    const []=useState
    return(
        <div className="movies-container">
            {props.lista.map((individual_movie)=>(
                <Movie
                    key={individual_movie.id}
                    title={individual_movie.titulo}
                    descricao={individual_movie.desc}
                    capa={individual_movie.cover}
                    data={individual_movie.release}
                    valor={individual_movie.valor}
                    vaga={individual_movie.vagas}
                    loginControler={props.loginControler} login={props.login}
                ></Movie>
        ))}
        </div>

    )
}
export default MovieList
